import React, { Component } from 'react'
import { NavLink } from 'react-router-dom';

import { connect } from 'react-redux';
import {LOGOUT} from '../../redux/actions/authActions';

class SignedIn extends Component {

 render(){
  return (
    <React.Fragment>
       <ul className="right">
           <li><NavLink   to="/"><i className="material-icons">collections</i></NavLink></li>
           <li><NavLink to="/"><i className="material-icons">add_a_photo</i></NavLink></li>
           <li><NavLink  onClick={()=>this.props.LOGOUT(this.props)} to="/" ><img style={{width:"40px",height:"40px",borderRadius:"40px",verticalAlign:"middle"}} src="https://avatars2.githubusercontent.com/u/51698550?s=460&u=b2a9911e8c6e6dc7f76328e3a3495a60a043b869&v=4"/></NavLink></li>
           <li><NavLink to="#"><i  onClick={this.props.onLoginClick}  className="material-icons">power_settings_new</i></NavLink></li>  
       </ul> 

    </React.Fragment>   
   )
 }
}

const mapDispatchToProps=(dispatch)=>{
    return {
      LOGOUT:(props)=>{dispatch(LOGOUT(props))}
    }
  }

export default connect(null,mapDispatchToProps)(SignedIn);
